import React from "react";
import { emptyProfilePicture } from "../constants/data";
import Footer from "./Footer";


const Wrapper=styled(Box)`

`
const Component=styled(Box)`
height: 77vh;
overflow-y: scroll;
`

const Messages=()=>{
    return (
        <Wrapper>
            <Component>

            </Component>
            <Footer />
        </Wrapper>
    );
}

export default Messages;
